pragma solidity ^0.4.13;


import "./owned.sol";

contract ShareRevenueContractinEther is owned {

    ///////////////////////
    // GENERAL STRUCTURE //
    ///////////////////////

    // REVENUE SHARING
    uint8 sharingAmountForFirstPartyEther;

    // PARTIES
    address firstPartyAddress;
    address secondPartyAddress;

    ////////////
    // EVENTS //
    //////////// 

    ///////////////////
    // DEPOSIT ETHER //
    ///////////////////
    function depositEther() payable {
        uint amountInWei = msg.value;
        uint amountInWeiForFirstParty = amountInWei * sharingAmountForFirstPartyEther / 100;
        uint amountInWeiForSecondParty = amountInWei - amountInWeiForFirstParty;
        firstPartyAddress.transfer(amountInWeiForFirstParty);
        secondPartyAddress.transfer(amountInWeiForSecondParty);
    }

    function getMyBalance() constant returns (uint) { return this.balance; }

    //////////////////////
    // PARTY MANAGEMENT //
    //////////////////////

    function getFirstPartyAddress() constant returns (address){
        return firstPartyAddress;
    }

    function getSecondPartyAddress() constant returns (address){
        return secondPartyAddress;
    }

    function getsharingAmountForFirstPartyEther() constant returns (uint8){
        return sharingAmountForFirstPartyEther;
    }

    function updatePartyAdress(address _first_party_address, address _second_party_address) {
        firstPartyAddress = _first_party_address;
        secondPartyAddress = _second_party_address;
    }

    function updateShareAmountForEther(uint8 _x) {
        require(_x <= 100);
        sharingAmountForFirstPartyEther = _x;
    }
}
